import {React, ReactDOM} from 'react';
import {BrowserRouter, Routes} from 'react-router-dom';
import Home from '../Pages/';
import Employee from '../Menus/Employee';
import Company from '../Menus/Company';
import Configuration from '../Menus/Configuration';
import EmployeeItem from '../Items/EmployeeItem';
import CompanyItem from '../Items/CompanyItem';

const routing = () => {
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/app" element={<Home />} />
                <Route path="/Employees" element={<Employee />} />
                <Route path="/Employees/:id" element={<EmployeeItem />} />
                <Route path="/Configuration" element={<Configuration />} />
                <Route path="/Companies" element={<Company />} />
            </Routes>
        </BrowserRouter>
    );
}

ReactDOM.render(routing, document.getElementById('root'));
